#include <iostream>
#include <string>

int main()
{
	const std::string input[]{ "",
		"",
		"",
		"",
		"" };

	int key{ 5 };
	int code{ 0 };
	for (auto s : input)
	{
		for (auto c : s)
		{
			switch (c)
			{
			case 'U':
				if (key > 3) key -= 3;
				break;
			case 'D':
				if (key < 7) key += 3;
				break;
			case 'L':
				if (key%3 != 1) --key;
				break;
			case 'R':
				if (key % 3 != 0) ++key;
				break;
			default:
				break;
			}
		}
		code *= 10;
		code += key;
	}
	std::cout << "Code: " << code << std::endl;
	return 0;
}